import React, { Component } from "react";
import { NavLink } from "react-router-dom";

class SignUp extends Component {
  render() {
    return (
      <div className="SignUp">
        <NavLink to="/SignUp">Create Account</NavLink>
      </div>
    );
  }
}

export default SignUp;
